import React, { useState } from 'react';
import { Form, Input, Checkbox, Switch, Radio, Button, Select, Typography } from 'antd';
import "./FormComponent.css";

const { Group: RadioGroup } = Radio;

const { Option } = Select;

const FormComponent: React.FC = () => {

  const inputText = [
    {
      title: 'Username',
      value: 'username',
      type: 'text',
      placeHolder: 'Enter username',
      error: 'Please input your username!',
    },
    {
      title: 'Password',
      value: 'password',
      type: 'password',
      note: 'Your password is betwween 4 and 12 characters',
      placeHolder: 'Enter password',
      error: 'Please input your password!',

    },
    {
      title: 'Text Field',
      value: 'textField',
      type: 'text',
      placeHolder: 'Input Field',
      error: 'Please input text field!',
    },
  ];

  const [rememberMe, setRememberMe] = useState(false);
  const [switchValue, setSwitchValue] = useState(false);
  const [radioValue, setRadioValue] = useState(1);

  const handleSwitchChange = (checked: boolean) => {
    setSwitchValue(checked);
  };

  const handleRadioChange = (e: any) => {
    setRadioValue(e.target.value);
  };

  const handleCancel = () => {
    // 
  };

  const handleNext = () => {
    // 
  };

  const options = [
    { label: 'Option 1', value: 'option1' },
    { label: 'Option 2', value: 'option2' },
    { label: 'Option 3', value: 'option3' },
  ];

  return (
    <div className="form-container">
      <Form>
        <div className='form-content'>
          <Form.Item name="FormConponent" className='input-field'>
            {inputText.map((item) => (
              <div
                key={item.value}
                className='form-group'
                >
                <Typography.Text className='title'>{item.title}</Typography.Text>
                <div>
                  <Form.Item
                    name={item.value}
                    rules={[
                      {
                        required: true,
                        message: item.error,
                      },
                    ]}
                  >
                    <Input
                      type={item.type}
                      placeholder={item.placeHolder}
                    />
                  </Form.Item>
                  <span>Your password is betwween 4 and 12 characters</span>
                </div>
              </div>
            ))}
          </Form.Item>
          <div className='form-group'>
            <Form.Item>
              <Checkbox
                checked={rememberMe}
                onChange={e => setRememberMe(e.target.checked)}
              >
                Remember me
              </Checkbox>
            </Form.Item>
          </div>
          <div className='form-group'>
            <Form.Item>
              <Switch
                checked={switchValue}
                onChange={handleSwitchChange}
              /> On
            </Form.Item>
          </div>
          <div className='form-group'>
            <Form.Item>
              <RadioGroup
                onChange={handleRadioChange}
                value={radioValue}>
                  <div>
                <Radio value={1}>Button 1</Radio>
                </div>
                <div>
                <Radio value={2}>Button 2</Radio>
                </div>
                <div>
                <Radio value={2}>Button 3</Radio>
                </div>
              </RadioGroup>
            </Form.Item>
          </div>
          <div className='form-group'>
            <Form.Item>
              <label className="dropdown-title">Dropdown Title</label>
              <Form.Item name="dropdown">
                <Select placeholder="Select option">
                  {options.map(option => (
                    <Option key={option.value} value={option.value}>
                      {option.label}
                    </Option>
                  ))}
                </Select>
              </Form.Item>
            </Form.Item>
          </div>
          <div>
            <Form.Item>
              <Button onClick={handleCancel}> Cancel </Button>
              <Button type="primary" onClick={handleNext}> Next </Button>
            </Form.Item>
          </div>
        </div>
      </Form>
    </div>
  );
};

export default FormComponent;
